import React from 'react';
import { Link } from 'react-router-dom';
import ThemeToggle from './ThemeToggle';

const NavBar = () => {
  return (
    <nav className="bg-white dark:bg-gray-800 p-4 shadow-lg">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo or Portfolio Name */}
        <Link to="/" className="text-gray-800 dark:text-white text-xl font-bold">
          My Portfolio
        </Link>

        {/* Navigation Links */}
        <div className="flex items-center space-x-4">
          <Link to="/" className="text-gray-800 dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition duration-300">
            Home
          </Link>
          <Link to="/about" className="text-gray-800 dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition duration-300">
            About Me
          </Link>
          <Link to="/projects" className="text-gray-800 dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition duration-300">
            Projects
          </Link>
          <Link to="/blogs" className="text-gray-800 dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition duration-300">
            Blogs
          </Link>
          <Link to="/contact" className="text-gray-800 dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition duration-300">
            Contact
          </Link>
          <ThemeToggle />
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
